export const EVENTS = {
    show: 'fui-toast-show',
    dismiss: 'fui-toast-dismiss',
    dismissAll: 'fui-toast-dismiss-all',
    update: 'fui-toast-update',
    pause: 'fui-toast-pause',
    play: 'fui-toast-play'
};
export const TOAST_POSITIONS = {
    bottomEnd: 'bottom-end',
    bottomStart: 'bottom-start',
    topEnd: 'top-end',
    topStart: 'top-start'
};
